description:
Verenigde Staten
Komedie
102 minuten

goed

met Bradley Cooper, Zach Galifianakis en Ed Helms

Phil, Stu, Alan en Doug reizen af naar het exotische Thailand voor de bruiloft van Stu. Na het onvergetelijke vrijgezellenfeest
in Las Vegas wat uitliep op een grote ravage kiest Stu nu voor een veilige, ingetogen 'pre-bruiloft' brunch. Echter, niets 
verloopt zoals gepland. What happens in Vegas, may stay in Vegas, maar wat het gezelschap in Bangkok staat te wachten 
overtreft al hun verwachtingen...
